//import './App.css';

import ProtectedRoute from './ProtectedRoute.js';

import Inicio from './Inicio/Inicio.js';
import Navbar from './Navbar.js'


import CompCatalogo from './Catalogo.js';
import CompResultadosBusqueda from './ResultadoBusqueda.js';

//Importar componentes 
import CompShowLibros from './libro/ShowLibros.js';
import CompCreateLibro from './libro/CreateLibro.js';
import CompEditLibro from './libro/EditLibro.js';

import Login from './Login.js';
import Registro from './Registro.js';

import CompReservaForm from './ReservaForm.js';
//Importar router
import { BrowserRouter, Route, Routes } from 'react-router-dom';






function App() {
  return (

      <BrowserRouter>
      <Navbar />
        <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/registro" element={<Registro />} />
          <Route path='/' element={<Inicio />} />
          <Route path='/' element={<Navbar />} />
          <Route path='/catalogo' element={<CompCatalogo/>} />
          <Route path='/resultados/:termino' element={<CompResultadosBusqueda/>} />
          <Route path='/' element={ <CompShowLibros />}/>
          <Route path='/create' element={ <CompCreateLibro />}/>
          <Route path='/edit/:id_libro' element={ <CompEditLibro />}/>


          {/* Rutas protegidas */}
          <Route
        path="/reservar"
        element={
          <ProtectedRoute>
            <FormularioReserva />
          </ProtectedRoute>
        }
      />

        </Routes>
      </BrowserRouter>

  );
}

//<Route path='/reservar/:id_libro' element={<CompReservaForm/>} />

export default App;
